import React from "react";
import InlineA from "../InlineA";
import "./Footer.css";

const Footer = props => (
	<footer class="bg-color-222-239-247 border-top-p75em-double-10-33-47 bottom-0 color-10-33-47 font-catamaran font-size-p8em height-2p75em justify-content-center position-fixed width-100pc">

            { props.currentPage = "Home" &&
                <nav className="display-flex flex-direction-row position-relative top-p5em">
                    <Span>Home</Span>
                    <InlineA
                        colorSchemeSuffix="default"
                        isInternalLink={ true }
                        text="Food Access"
                        urlPath="/FoodAccessOverview"
                    />
                    <InlineA
                        colorSchemeSuffix="default"
                        isInternalLink={ true }
                        text="Healthy Bodegas"
                        urlPath="/HealthyBodegas"
                    />
                    <InlineA
                        colorSchemeSuffix="default"
                        isInternalLink={ true }
                        text="Recipes"
                        urlPath="/Recipes"
                    />
                    <InlineA
                        colorSchemeSuffix="default"
                        isInternalLink={ true }
                        text="Resources"
                        urlPath="/Resources"
                    />
                </nav>
            };
    </footer>
);

export default Footer;
